const range = (x, y) => Array.from(Array(y).keys()).slice(x);
const ord = (x) => x.charCodeAt(0);
const chr = (x) => String.fromCharCode(x);
const textEncoder = new TextEncoder();
const encodeStr = (str) =>
  Array.from(textEncoder.encode(str)).map((x) => x.toString());
const textDecoder = new TextDecoder("utf-8");
const decodeStr = (arr) => textDecoder.decode(new Uint8Array(arr));

const dictZip = (x, y) => {
  const result = {};
  x.map((_, i) => {
    result[x[i]] = y[i];
  });
  return result;
};

function bytes_to_unicode() {
  const bs = range(ord("!"), ord("~") + 1).concat(
    range(ord("¡"), ord("¬") + 1),
    range(ord("®"), ord("ÿ") + 1)
  );

  let cs = bs.slice();
  let n = 0;
  for (let b = 0; b < 2 ** 8; b++) {
    if (!bs.includes(b)) {
      bs.push(b);
      cs.push(2 ** 8 + n);
      n = n + 1;
    }
  }

  cs = cs.map((x) => chr(x));

  const result = {};
  bs.map((_, i) => {
    result[bs[i]] = cs[i];
  });
  return result;
}

const get_pairs = (word) => {
  const pairs = new Set();
  let prev_char = word[0];
  for (let i = 1; i < word.length; i++) {
    const char = word[i];
    pairs.add([prev_char, char]);
    prev_char = char;
  }
  return pairs;
};

const pat =
  /'s|'t|'re|'ve|'m|'l l|'d| ?\p{L}+| ?\p{N}+| ?[^\s\p{L}\p{N}]+|\s+(?!\S)|\s+/gu;

const decoder = {};
Object.keys(encoder).map((x) => {
  decoder[encoder[x]] = x;
});

const lines = bpe_file.split("\n");

const bpe_merges = lines.slice(1, lines.length - 1).map((x) => {
  return x.split(/(\s+)/).filter(function (e) {
    return e.trim().length > 0;
  });
});

const byte_encoder = bytes_to_unicode();
const bpe_ranks = dictZip(bpe_merges, range(0, bpe_merges.length));
const cache = {};

const bpe = (token) => {
  if (cache.hasOwnProperty(token)) {
    return cache[token];
  }

  let word = token.split("");

  let pairs = get_pairs(word);

  if (!pairs) {
    return token;
  }

  while (true) {
    const minPairs = {};
    Array.from(pairs).map((pair) => {
      const rank = bpe_ranks[pair];
      minPairs[isNaN(rank) ? 10e10 : rank] = pair;
    });

    const bigram =
      minPairs[
        Math.min(
          ...Object.keys(minPairs).map((x) => {
            return parseInt(x);
          })
        )
      ];

    if (!bpe_ranks.hasOwnProperty(bigram)) {
      break;
    }

    const first = bigram[0];
    const second = bigram[1];
    let new_word = [];
    let i = 0;

    while (i < word.length) {
      const j = word.indexOf(first, i);
      if (j === -1) {
        new_word = new_word.concat(word.slice(i));
        break;
      }
      new_word = new_word.concat(word.slice(i, j));
      i = j;

      if (word[i] === first && i < word.length - 1 && word[i + 1] === second) {
        new_word.push(first + second);
        i = i + 2;
      } else {
        new_word.push(word[i]);
        i = i + 1;
      }
    }

    word = new_word;
    if (word.length === 1) {
      break;
    } else {
      pairs = get_pairs(word);
    }
  }

  word = word.join(" ");
  cache[token] = word;

  return word;
};

export default (text: string) => {
  let i = 0;
  const matches = Array.from(text.matchAll(pat)).map((x) => x[0]);
  for (let token of matches) {
    token = encodeStr(token)
      .map((x) => byte_encoder[x])
      .join("");
    i += bpe(token).split(" ").length;
  }
  return i;
};
